package Depuraciones;

public class Depuracion6 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
				int producto;
				for(int i=0; i<=10;i++) {
					for(int j=0; j<=10;j++) {
						producto=i*j;
						System.out.println(i+" * "+j+" = "+producto);
					}
					System.out.println();
				}
	}

}
